import React from "react";

export default class ContactForm extends React.Component {
    render() {
        const display = {
            display: this.props.display
        }
        return (
            <div style={display}>
                <form className="form">
                    <label>
                        Firstname
                        <input type="text" />
                    </label>
                    <label>
                        lastname
                        <input type="text" />
                    </label>
                    <label>
                        Phone Number
                        <input type="tel" />
                    </label>
                    <input type="submit" value="Add contact" />
                </form>
            </div>
        );
    }
}
